"saml.recycleEmails.descripiton":{en:"We require email addresses to be globally unique. Select this if your organization reuses email addresses. Old user accounts will then be deleted when Lucid Software detects that an email address has been reused."},"comparisonTable.basic.sharing.control":{en:"Basic sharing control"},"payment.cvv.about.main":{fr:"Le cryptogramme (ou code de s\u00e9curit\u00e9) se compose des 3 ou 4 derniers chiffres au dos de votre carte bancaire. Ce code n'apparait que  votre carte, sur aucun autre document. Vous devez \u00eatre en possession de votre carte pour connaitre le code, cela permet de s\u00e9curiser les transactions.",
en:"The CVV (or the Security Code) is a 3- or 4-digit number printed on your credit card. This number is only printed on your card, and is not stored anywhere. The only way to know the number is to physically have the card, making this a valuable security measure.",nl:"De CVV (of Beveiligingscode) is een 3- of 4-cijferig nummer gedrukt op de achterkant van uw kredietkaart. Dit nummer is enkel op uw kaart gedrukt, en is nergens anders terug te vinden. De enige manier om het nummer te kennen is door effectief de kaart in handen te hebben, wat er voor zorgt dat het een waardevolle veiligheidsmaatregel is.",
pt:"O CVV (ou c\u00f3digo de seguran\u00e7a) s\u00e3o os 3 ou 4 d\u00edgitos impresso no verso do seu cart\u00e3o de cr\u00e9dito.  Este n\u00famero s\u00f3 est\u00e1 impresso no seu cart\u00e3o, e ele n\u00e3o \u00e9 armazenado em nenhum outro lugar. A \u00fanica maneira de saber o n\u00famero CVV, \u00e9 ao ter o cart\u00e3o f\u00edsico; tornando-o uma importante medida de seguran\u00e7a.",no:"CVV (eller sikkerhetskode) er et 3- eller firesifret nummer trykt p\u00e5 ditt kredittkort. Dette nummeret er kun trykt p\u00e5 kortet ditt, og vil aldri bli lagret noe annet sted. Eneste m\u00e5te du kan vite nummeret p\u00e5 , er \u00e5 ha kortet fysisk. Dette gj\u00f8r det til et verdifullt sikkerhetstiltak.",
"zh-tw":"\u4fe1\u7528\u5361\u9a57\u8b49\u78bc(\u4ea6\u7a31\u5b89\u5168\u78bc)\u662f\u6253\u5370\u65bc\u60a8\u4fe1\u7528\u5361\u4e0a\u76843\u4f4d\u62164\u4f4d\u6578\u5b57\u3002\u9a57\u8b49\u78bc\u50c5\u6253\u5370\u65bc\u60a8\u7684\u4fe1\u7528\u5361\u4e0a\u800c\u4e0d\u6703\u51fa\u73fe\u5728\u4efb\u4f55\u5176\u4ed6\u5730\u65b9\u3002\u56e0\u6b64\u77e5\u66c9\u9a57\u8b49\u78bc\u7684\u552f\u4e00\u65b9\u6cd5\u4fbf\u662f\u771f\u6b63\u6301\u6709\u4fe1\u7528\u5361\uff0c\u9019\u4f7f\u5176\u6210\u70ba\u4e00\u9805\u91cd\u8981\u7684\u5b89\u5168\u63aa\u65bd\u3002",
de:"Die (oder der Kartenpr\u00fcfnummer) ist eine drei- oder vier- stellige Zahl auf Ihrer Kreditkarte. Sie ist nur auf Ihre Karte gedruckt und sonst nirgendwo gespeichert. Um diese Nummer zu kennen, muss man die Karte selbst besitzen. Daher ist sie eine wertvolle Sicherheitsma\u00dfname.",da:"CVV (eller Sikkerhedskoden) er et 3- eller 4-cifret tal, der er trykt p\u00e5 dit kreditkort. Dette tal er kun trykt p\u00e5 kortet og st\u00e5r ikke andre steder. Den eneste m\u00e5de, man kan vide nummeret p\u00e5, er hvis man rent faktisk har kortet, hvilket g\u00f8r dette til en v\u00e6rdifuld sikkerhedsforanstaltning.",
"zh-cn":"\u4fe1\u7528\u5361\u9a8c\u8bc1\u7801(\u4ea6\u79f0\u5b89\u5168\u7801)\u662f\u6253\u5370\u4e8e\u60a8\u4fe1\u7528\u5361\u4e0a\u76843\u4f4d\u62164\u4f4d\u6570\u5b57\u3002\u9a8c\u8bc1\u7801\u4ec5\u6253\u5370\u4e8e\u60a8\u7684\u4fe1\u7528\u5361\u4e0a\u800c\u4e0d\u4f1a\u51fa\u73b0\u5728\u4efb\u4f55\u5176\u4ed6\u5730\u65b9\u3002\u56e0\u6b64\u77e5\u6653\u9a8c\u8bc1\u7801\u7684\u552f\u4e00\u65b9\u6cd5\u4fbf\u662f\u771f\u6b63\u6301\u6709\u4fe1\u7528\u5361\uff0c\u8fd9\u4f7f\u5176\u6210\u4e3a\u4e00\u9879\u91cd\u8981\u7684\u5b89\u5168\u63aa\u65bd\u3002",
ja:"CVV\uff08\u3082\u3057\u304f\u306f\u30bb\u30ad\u30e5\u30ea\u30c6\u30a3\u30b3\u30fc\u30c9\uff09\u3068\u306f\u3001\u30af\u30ec\u30b8\u30c3\u30c8\u30ab\u30fc\u30c9\u306b\u8a18\u8f09\u3055\u308c\u3066\u3044\u308b\uff13\u6841\u3082\u3057\u304f\u306f\uff14\u6841\u306e\u6570\u5b57\u306e\u3053\u3068\u3067\u3059\u3002\u3053\u306e\u6570\u5b57\u306f\u30ab\u30fc\u30c9\u306b\u306e\u307f\u8a18\u8f09\u3055\u308c\u3066\u304a\u308a\u3001\u4ed6\u306b\u306f\u3069\u3053\u306b\u3082\u4fdd\u5b58\u3055\u308c\u3066\u3044\u307e\u305b\u3093\u3002\u3053\u306e\u756a\u53f7\u3092\u77e5\u308b\u306b\u306f\u3001\u30ab\u30fc\u30c9\u3092\u5b9f\u969b\u306b\u6301\u3063\u3066\u3044\u308b\u3057\u304b\u65b9\u6cd5\u304c\u306a\u304f\u3001\u6709\u76ca\u306a\u5b89\u5168\u5bfe\u7b56\u3068\u306a\u3063\u3066\u3044\u307e\u3059\u3002",
es:"El CVV (o C\u00f3digo de Seguridad) es un n\u00famero de 3 o 4 d\u00edgitos impreso en su tarjeta de cr\u00e9dito. Este n\u00famero solamente est\u00e1 impreso en la tarjeta y no se almacena en ninguna otra parte. La \u00fanica forma de conocer el n\u00famero es teniendo la tarjeta en f\u00edsico, lo cual hace de esta caracter\u00edsticas una importante medida de seguridad."},"menu.masterpage.duplicate":{fr:"Dupliquer le mod\u00e8le",en:"Duplicate Master"},"notice.trial.expires.edu.resend":{en:"Resend my confirmation email."},
