en:"You will always have access to your documents whether or not you choose a paid subscription. Due to the limitations of the Free plan, however, you may not be able to edit a document if it is beyond 60 objects in complexity.",nl:"U heeft altijd toegang tot uw documenten, ook als u niet kiest voor een betaald abonnement. Door de beperkingen van het gratis plan, kan het zijn dat u niet in staat zult zijn om een document te bewerken als het meer dan 60 objecten bevat.",pt:"Voc\u00ea sempre ter\u00e1 acesso aos seus documentos, independentemente se escolher ou n\u00e3o uma assinatura paga. Devido \u00e0s limita\u00e7\u00f5es do plano Gratuito, por\u00e9m, voc\u00ea n\u00e3o poder\u00e1 editar um documento se ele tiver mais de 60 objetos em complexidade.",
no:"Du vil alltid ha tilgang til dine dokumenter uansett om du velger \u00e5 betale for et abonnement eller ikke. P\u00e5 grunn av gratisversjonens begrensninger vil du derimot ikke ha muligheten til \u00e5 redigere et dokument dersom det har mer enn 60 objekter.",de:"Sie werden immer auf Ihre Dokumente zugreifen k\u00f6nnen, ob Sie nun ein kostenpflichtiges Abonnement abschlie\u00dfen oder nicht. Aufgrund der Beschr\u00e4nkungen der kostenfreien (\u201eFree\u201c) Zugangsoption k\u00f6nnen Sie allerdings keine Dokumente bearbeiten, die mehr als 60 Objekte haben.",
