"payment.cvv.about.americanExpress.text":{fr:"Sur le devant de votre carte, le cryptogramme se compose des quatre chiffres au-dessus des chiffres en relief.",en:"Look on the front of your card, above the embossed numbers. The four printed numbers are your CVV.",nl:"Kijk op de voorkant van uw kaart, boven de geprente cijfers. De vier gedrukte cijfers zijn uw CVV.",pt:"Olhe na parte da frente do seu cart\u00e3o, acima dos n\u00fameros em alto relevo.  Os quatro n\u00fameros impressos s\u00e3o o seu CVV.",
no:"Over de trykte numrene p\u00e5 forsiden av kortet, finner du fire sifre. Disse er ditt CVV-nummer.","zh-tw":"\u67e5\u770b\u60a8\u4fe1\u7528\u5361\u7684\u6b63\u9762\uff0c\u58d3\u5370\u51f8\u8d77\u7684\u6578\u5b57\u4e0a\u65b9\u6253\u5370\u7684\u56db\u4f4d\u6578\u5b57\u4fbf\u662f\u60a8\u7684\u9a57\u8b49\u78bc\u3002",de:"Schauen Sie auf die Vorderseite der Karte, oberhalb der gepr\u00e4gten Zahlen. Die vier gedruckten Zahlen sind Ihre Kartenpr\u00fcfnummer.",da:"Se p\u00e5 forsiden af dit kort over de oph\u00f8jede bogstaver. De fire trykte tal er dit CVV.",
"zh-cn":"\u67e5\u770b\u60a8\u4fe1\u7528\u5361\u7684\u6b63\u9762\uff0c\u538b\u5370\u51f8\u8d77\u7684\u6570\u5b57\u4e0a\u65b9\u6253\u5370\u7684\u56db\u4f4d\u6570\u5b57\u4fbf\u662f\u60a8\u7684\u9a8c\u8bc1\u7801\u3002",ja:"\u30ab\u30fc\u30c9\u8868\u9762\u306b\u8a18\u8f09\u3055\u308c\u3066\u3044\u308b\u30ab\u30fc\u30c9\u756a\u53f7\u306e\u3059\u3050\u4e0a\u306b\u8a18\u8f09\u3055\u308c\u3066\u3044\u308b\uff14\u6841\u306e\u756a\u53f7\u304cCVV\u30b3\u30fc\u30c9\u3067\u3059\u3002",es:"Ubique en la parte frontal de su tarjeta, encima de los n\u00fameros en relieve los cuatro n\u00fameros impresos que corresponden a su CVV."},
