pt:"Pronto para fazer um upgrade? Pague agora para garantir a sua assinatura Lucid%s. Se voc\u00ea deixar seu per\u00edodo de trial expirar, voc\u00ea ser\u00e1 rebaixado para uma conta gratuita.  Voc\u00ea ter\u00e1 recursos limitados e algumas restri\u00e7\u00f5es de uso, mas voc\u00ea ainda poder\u00e1 acessar seus documentos. N\u00e3o est\u00e1 pronto? %s",no:"Klar for \u00e5 oppgradere? Betal n\u00e5 for \u00e5 l\u00e5se ditt Lucid%s-abonnement. Hvis ditt pr\u00f8veabonnement utl\u00f8per, s\u00e5 vil du bli nedgradert til en gratiskonto. Du vil f\u00e5 begrensede funksjoner og restriksjoner p\u00e5 bruk, men du vil fortsatt ha tilgang til dine dokumenter. Ikke klar? %s",
