"embedpanel.chkbox.label":{fr:"Publie le lien",en:"Publish Link",zh:"\u53d1\u5e03\u94fe\u63a5"},"pricing.quote1.content":{fr:"Beaucoup de nos clients souhaitent communiquer par des documents Visio, et avec Lucidchart, nous pouvons exporter les fichiers en format Visio. Lorsque nous envoyons ces diagrammes, nous pouvons choisir le format PDF ou Visio, et cette flexibilit\u00e9 est tr\u00e8s importante. De plus, Lucidchart \u00e9tait moins cher et ne n\u00e9cessitait pas une installation sur l'ordinateur de tout le monde.",
en:"A lot of our customers want to communicate through Visio documents, and with Lucidchart, we can export into standard Visio file formats. When we send those diagrams, we can choose from PDF or Visio format, and that flexibility is very important. Plus, Lucidchart was less expensive and didn't need to be installed on everybody's machine.",nl:"Veel van onze klanten willen communiceren via Visio-documenten, en met Lucidchart kunnen we exporteren naar standaard Visio-bestandsformaten. Wanneer we deze diagrammen versturen, kunnen we kiezen uit PDF-of Visio-formaat, en die flexibiliteit is zeer belangrijk. Bovendien was Lucidchart minder duur en hoefde het niet op elke machine ge\u00efnstalleerd te worden.",
pt:"Muitos de nossos clientes querem se comunicar usando documentos do Visio e, com o Lucidchart, podemos exportar para formatos de arquivos padr\u00e3o do Visio. Quando enviamos esses diagramas, podemos escolher entre o formato PDF ou Visio, e essa flexibilidade \u00e9 muito importante. Al\u00e9m disso, o Lucidchart era mais barato e n\u00e3o precisava ser instalado na m\u00e1quina de todos.",no:"Mange av v\u00e5re kunder vil kommunisere gjennom Visiodokumenter, og med Lucidchart kan vi eksportere til standard Visioformater. N\u00e5r vi sender disse diagrammene, kan vi velge mellom PDF eller Visioformat, og denne fleksibiliteten er veldig viktig. I tillegg var Lucidchart billigere og m\u00e5tte ikke installeres p\u00e5 alle maskinene.",
de:"Viele unserer Kunden wollen gern mittels Visio-Dokumenten kommunizieren. Mit Lucidchart k\u00f6nnen wir einfach in standardm\u00e4\u00dfige Visio-Dateiformate exportieren. Beim Senden dieser Diagramme k\u00f6nnen wir zwischen PDF und Visio-Format w\u00e4hlen und diese Flexibilit\u00e4t ist enorm wichtig f\u00fcr uns. Dar\u00fcber hinaus war Lucidchart g\u00fcnstiger und wir mussten es nicht auf allen Computern installieren.",da:"Mange af vores kunder \u00f8nsker at kommunikere gennem Visio dokumenter, og med Lucidchart, kan vi eksportere ind i standard Visio filformater. N\u00e5r vi sender disse diagrammer, kan vi v\u00e6lge mellem PDF eller Visio format, og den fleksibilitet er meget vigtig. Plus, Lucidchart var billigere, og beh\u00f8vede ikke at blive installeret, p\u00e5 alles maskiner.",
es:"Muchos de nuestros clientes quieren comunicarse con documentos de Visio, y con Lucidchart podemos exportar archivos a formatos est\u00e1ndar de Visio. Al enviar esos diagramas, podemos elegir entre los formatos PDF o Visio, y esa flexibilidad es muy importante. Adem\u00e1s, Lucidchart era m\u00e1s barato y no hab\u00eda que instalarlo en todos los ordenadores."},"registerLevel.eduPricing.prompt":{en:"Are you an EDU user?"},"amazonsurvey.description":{en:"In an effort to better understand our customers, we\u2019re offering a <strong>$25 Amazon Gift Card</strong> for a short phone call about how you use Lucidchart. Fill out this survey and we\u2019ll contact you if you qualify."},
