april:{fr:"04 - Avril",en:"04 - April",nl:"04 - April",pt:"04 - Abril",no:"04 - April","zh-tw":"4\u6708",de:"04 - April",da:"04 - April","zh-cn":"4\u6708",ja:"4\u6708",es:"04 - Abril"},"education.faq.press.classroom.answer":{en:"Teachers can use Lucidpress to create presentations, handouts, and other learning materials. Students can use it to design newsletters, brochures, flyers, reports, and other visual projects. They can also collaborate on group assignments and receive feedback from peers and teachers."},
